import { Button, Box } from "@chakra-ui/react";

const ButtonAdd = (props) => {
  return(
    <Box>
      <Button bg="#9D76C1" padding="15px" border="none" fontSize="15px" borderRadius="8px" cursor="pointer" color="#F1F1F1" fontWeight={600}>
         {props.children}
      </Button>
    </Box>
  );
}

export default ButtonAdd;
